import React from 'react';

import './QA.css';
import Grid from '@material-ui/core/Grid';
import 'materialize-css';
import { Collapsible, CollapsibleItem, Icon } from 'react-materialize';



const services = props => {
  return (
    <div className="">
        
        <Grid container className="">
        <Grid item md={2} xs={1}>
      </Grid>
      <Grid container md={8} xs={10} spacing={2}>
          <Grid item xs={6}><h2>Questions & Answers for Companies</h2></Grid>
          <Grid item xs={6}></Grid>
          <Grid item xs={12}>
          <Collapsible accordion={false}>
  <CollapsibleItem
    expanded={true}
    header="Better safe than sorry. That's my motto."
    node="div"
  >
    Better safe than sorry. That's my motto.
  </CollapsibleItem>
  <CollapsibleItem
    expanded={false}
    header="Yeah, you do seem to have a little 'shit creek' action going."
    node="div"
  >
    Yeah, you do seem to have a little 'shit creek' action going.
  </CollapsibleItem>
  <CollapsibleItem
    expanded={false}
    header="You know, FYI, you can buy a paddle. Did you not plan for this contingency?"
    node="div"
  >
    You know, FYI, you can buy a paddle. Did you not plan for this contingency?
  </CollapsibleItem>
</Collapsible>
          </Grid>
          
        
      </Grid>
      
      <Grid item md={2}>
      </Grid>
      </Grid>
</div>
  );
    
};

export default services;
